import React from 'react';
import ReactDOM from 'react-dom';
import './css/background.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import LoggedInNavbar from './elements/SharedElements/navbar&footer/loggedInNavbar';
import Navbar from './elements/SharedElements/navbar&footer/navbar';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root'),
  sessionStorage.getItem('email')?<LoggedInNavbar />:<Navbar />, 
  document.getElementsById('navbar')
);

ReactDOM.render(
  <React.Children>
    sessionStorage.getItem('email')?
    <LoggedInNavbar />
    :
    <Navbar />,
    </React.Children>,
  document.getElementsById('navbar')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
